import React from 'react';

function LoginPage() {
  return (
    // <div>
    //   LoginPage
    // </div>
    <div className='App'>
      <h1>LOGIN</h1>
      <h2>Please login below to see your budget details...</h2>
      <br/>
      <label>
        <h2>Username:</h2>
        {/* <img src='' alt='login icon'/><span style={{'padding-right':  10}}/> */}
        <input class='icon un' type='text' placeholder='Enter your username here...' autoFocus required/>
      </label>
      <br/>
      <br/>
      <label>
        <h2>Password:</h2>
        {/* <img src='' alt='password icon'/><span style={{'padding-right':  10}}/> */}
        <input class='icon pw' type='password' placeholder='Enter your password here...' required/>
      </label>
      <br/>
      <br/>
      <br/>
      <button class='login-button' type='submit'>Login</button>
    </div>
  );
}

export default LoginPage;
